const giveawayWinners = tempVars("giveawayWinners");
const giveawayID = tempVars("giveawayID");

msg.delete()

async function drawWinner() {
    if (!isNaN(giveawayWinners) && giveawayWinners > 0 && giveawayWinners != null || giveawayID != null && giveawayWinners != null) {
        var serverMessages = await msg.channel.messages.fetch({
            limit: 100
        });

        var messagesList = [];
        var winnerArray = [];
        var winnerText = "";
        var supposeGiveawayMSG;

        if (giveawayID == null) {
            serverMessages = serverMessages.array();
            serverMessages = serverMessages.filter(object => object.author.id == client.user.id);

            for (i = 0; i < serverMessages.length; i++) {
                let tempserverMsg = serverMessages[i];
                let tempserverEmbed = serverMessages[i]["embeds"][0];
                if (tempserverEmbed != null && tempserverMsg.reactions.cache.get('🎉') != null && tempserverEmbed.fields.length == 6 && tempserverEmbed.color == 0x000000 && tempserverEmbed.fields[5].value == "Ended") {
                    messagesList.push(serverMessages[i]);
                }
            }
        } else {
            supposeGiveawayMSG = await msg.channel.messages.fetch(giveawayID);
            var supposegiveawayEmbed = supposeGiveawayMSG["embeds"][0];
            if (supposeGiveawayMSG != null && supposegiveawayEmbed != null && supposeGiveawayMSG.reactions.cache.get('🎉') != null && supposegiveawayEmbed.fields.length == 6 && supposegiveawayEmbed.color == 0x000000 && supposegiveawayEmbed.fields[5].value == "Ended") {
                 messagesList.push(supposeGiveawayMSG);
            } else {
                errorMessage("Nieprawidłowe rozdanie !\n\nSprawdź ponownie swój identyfikator wiadomości! \n\nUpewnij się, że konkurs dobiegł końca!");
            }
        }

        if (messagesList.length > 0) {
            var giveawayMessage = messagesList[0];
            var giveawayEmojiCache = giveawayMessage.reactions.cache.get('🎉');
            var giveawayUsers = await giveawayEmojiCache.users.fetch();
            if (giveawayEmojiCache.count > 100) {
                for (i=0; i<giveawayEmojiCache.count; i++) {
                    var fetchedEmojiUsers = await giveawayEmojiCache.users.fetch({after: giveawayUsers.last().id});
                    await giveawayUsers.concat(fetchedEmojiUsers);
                }
            }

            giveawayUsers = await giveawayUsers.array();
            giveawayUsers = await giveawayUsers.filter(object => object.id != client.user.id);

            if (giveawayUsers.length > 0) {
                if (giveawayUsers.length > giveawayWinners) {
                    for (var i = 0; i < giveawayWinners; i++) {
                        var randomNumber = Math.floor(Math.random() * giveawayUsers.length);
                        winnerArray.push(`${giveawayUsers[randomNumber]}`);
                        giveawayUsers.splice(giveawayUsers.indexOf(randomNumber), randomNumber);
                    }
                } else if (giveawayUsers.length <= giveawayWinners) {
                    for (i = 0; i < giveawayUsers.length; i++) {
                        winnerArray.push(`${giveawayUsers[i]}`);
                    }
                }

                for (i = 0; i < winnerArray.length; i++) {
                    winnerText = winnerText + winnerArray[i] + '\n';
                }

                if (giveawayID != null) {
                    msg.channel.send("🎉 Giveaway Przerysuj  🎉\n\n Zwycięzcami są :\n" + winnerText + "\n" + "Wygrali/ał: " + giveawayMessage.embeds[0].fields[1].value);
                } else {
                    msg.channel.send("🎉 Giveaway  Przerysuj 🎉\n\n Zwycięzcami są :\n" + winnerText + "\n" + "Wygrali/ał: " + giveawayMessage.embeds[0].fields[1].value + "\nZwycięzca wylosowany z wiadomości: " + giveawayMessage.id);
                }


            } else {
                if (supposeGiveawayMSG == null) {
                  errorMessage("Nikt nie zareagował w ostatnim rozdaniu prowadzonym, nie może narysować członka !");
                } else  {
                  errorMessage("Nikt nie zareagował w wybranym konkursie hostowanym, nie może wylosować członka! ");
                }
            }
        } else if (supposeGiveawayMSG == null) {errorMessage("Nie ma ostatnio hostowanego rozdania, nie można narysować członka !\n\nUpewnij się, że konkurs dobiegł końca !");}
    } else {errorMessage("Podaj prawidłową liczbę graczy, którzy mają zostać wybrani do wygrania !");}

    function errorMessage(error) {
        let errorTemplate = {
            color: 0xFF0000,
            author: {
                name: client.user.username,
                icon_url: client.user.avatarURL
            },
            title: "Giveaway Draw",
            description: error,
            timestamp: new Date(),
        }

        msg.channel.send({embed:errorTemplate});
    }
}

if (msg.member.hasPermission(['MANAGE_CHANNELS'])) {
    drawWinner();
} else {
    errorMessage("Nie masz uprawnień do wykonania polecenia! ");
}

