const Discord = require("discord.js");
const fs = require('fs');
var embed = [];
var mainMessage;

//Setings
var timezone = "UTC"; // Default: UTC || Takes abbreviation timezones like EST, EDT, PST, etc.
var debug = false; // Default: false || Prints any errors that may have occured; will also print for await messages that ran out of time

try {
    new Date().toLocaleString("en-US", {
        timeZone: timezone
    })
} catch (e) {
    console.log(`${timezone} is an invalid timezone!\nResetting back to UTC.`);
    timezone = "UTC";
}

// Above checks validity of timezone, will reset to UTC if invalid.
// Please do not modify!

let embedTemplate = {
    color: 0xFFFF00,
    author: {
        name: client.user.username,
        icon_url: client.user.avatarURL
    },
    title: "Giveaway Setup",
    description: "To jest osadzenie testowe, aby pokazać, jak wyglądają i co potrafią. ",
    timestamp: new Date(),
}

var giveaway = {
    "itemGivingAway": "",
    "time": 0,
    "winner": 1,
    "finishUnix": 0,
    "channel": "",
    "server": msg.guild.id,
    "giveawayMessageID": "",
    "id": Math.floor(Math.random() * 999999) + 100000
}


if (msg.member.hasPermission('MANAGE_CHANNELS')) {
    embedTemplate["description"] = `Welcome to the giveaway promt.\n\nPlease first specify what embed title you would like for the giveaway.`;
    msg.channel.send({
            embed: embedTemplate
        })
        .then((message) => {
            mainMessage = message;
            askQuestion(`Witamy w zaproszeniu do konkursu.\n\nNajpierw określ, jaki tytuł chcesz umieścić w konkursie. `).then((response) => {
                embed[0] = response.content;
                askQuestion(`Tytuł osadzenia będzie  **${embed[0]}**\n\nJeśli wszystko się zgadza, wprowadź teraz opis!\nJeśli to nie jest prawda, anuluj giveaway za pomocą "cancel".`).then((response) => {
                    embed[1] = response.content
                    if (embed[1].toLowerCase() == "cancel") {
                        errorMessage('Prompt cancelled due to user cacellation. \nPlease re-execute the command to run through the prompt again!', "User responded with cancel thus cancelling the prompt");
                    } else {
                        embedTemplate["description"] = `The embed title will be **${embed[0]}** and the description is:\n\n${embed[1]}\n\nIf this is correct, please respond with "confirm" to send the embed!\nIf not, please respond with "cancel"`;
                        askQuestion(`Tytuł giveaway będzie  **${embed[0]}** a opis to:\n\n${embed[1]}\n\nJeśli wszystko się zgadza, odpowiedz „confirm”, aby wysłać osadzenie! \nJeśli nie, proszę o napisanie "cancel"`).then((response) => {
                            if (response.content.toLowerCase() == "confirm") {
                                askQuestion(`Teraz przejdź do konfiguracji  giveaway.\nTeraz określ, co rozdajesz! `).then((response) => {
                                    giveaway["itemGivingAway"] = response.content;
                                    askQuestion(`rozdajesz "${response.content}" prawda?\n\nJeśli tak, odpowiedz teraz, podając liczbę zwycięzców, których chciałbyś mieć. \nJeśli nie, odpowiedz, podając cokolwiek innego`).then((response) => {
                                        if (!isNaN(response.content)) {
                                            if (parseInt(response.content) > 0) {
                                                giveaway["winner"] = parseInt(response.content);
                                                askQuestion(`rozdajesz "${giveaway["itemGivingAway"]}" do ${response.content} użytkowników/ka.\n\njeśli wszystko się zgadza, prosimy o podanie ilości czasu przeznaczonego na giveaway.\nEx. 1w | 1d | 1h | 1m`).then((response) => {
                                                    let tempTime = response.content.toLowerCase();
                                                    if (tempTime.includes("d") || tempTime.includes("h") || tempTime.includes("w") || tempTime.includes("m")) {
                                                        let timeUp;
                                                        let timeText;

                                                        if (tempTime.includes("d")) {
                                                            timeUp = "d";
                                                            timeText = "dzień/dnie";
                                                        } else if (tempTime.includes("h")) {
                                                            timeUp = "h";
                                                            timeText = "godzina/ny)";
                                                        } else if (tempTime.includes("w")) {
                                                            timeUp = "w";
                                                            timeText = "tydzień/tygodnie)";
                                                        } else if (tempTime.includes("m")) {
                                                            timeUp = "m";
                                                            timeText = "minute/ty";
                                                        }

                                                        tempTime = tempTime.split(timeUp);
                                                        if (!isNaN(tempTime[0])) {
                                                            tempTime[0] = parseInt(tempTime[0]);
                                                            switch (timeUp) {
                                                                case "d":
                                                                    giveaway["time"] = tempTime[0] * 86400;
                                                                    break;
                                                                case "h":
                                                                    giveaway["time"] = tempTime[0] * 3600;
                                                                    break;
                                                                case "w":
                                                                    giveaway["time"] = tempTime[0] * 604800;
                                                                    break;
                                                                case "m":
                                                                    giveaway["time"] = tempTime[0] * 60;
                                                                    break;
                                                            }
                                                            askQuestion(`Rozdajesz "${giveaway["itemGivingAway"]}" do ${giveaway["winner"]} użytkowników/ka\nZwycięzca zostanie wylosowany  ${tempTime[0]} ${timeText}\n\nJeśli wszystko się zgadza, podaj teraz kanał, na którym zostanie opublikowany konkurs. `).then((response) => {
                                                                if (response.mentions.channels.first() != null) {
                                                                    let giveawayChannel = response.mentions.channels.first();
                                                                    giveaway["channel"] = giveawayChannel.id;
                                                                    giveaway["finishUnix"] = Math.floor(Date.now() / 1000) + giveaway["time"];

                                                                    var giveawayEmbed = {
                                                                        color: 0x2E7F98,
                                                                        author: {
                                                                            name: embed[0],
                                                                            icon_url: client.user.avatarURL
                                                                        },
                                                                        description: embed[1],
                                                                        fields: [{
                                                                                name: '\u200b',
                                                                                value: '\u200b',
                                                                                inline: false,
                                                                            },
                                                                            {
                                                                                name: 'Do wygrania: ',
                                                                                value: giveaway["itemGivingAway"],
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway stworzył/a:',
                                                                                value: `${msg.author}`,
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Rozpoczęto o ',
                                                                                value: new Date().toLocaleString("en-US", {
                                                                                    timeZone: timezone
                                                                                }),
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Kończy się o ',
                                                                                value: new Date(giveaway["finishUnix"] * 1000).toLocaleString("en-US", {
                                                                                    timeZone: timezone
                                                                                }),
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Status',
                                                                                value: "Active/Ongoing",
                                                                                inline: true,
                                                                            },
                                                                        ],
                                                                        footer: {
                                                                            text: `Konkurs kończy się  ${new Date(giveaway["finishUnix"] * 1000).toLocaleString("en-US", { timeZone: timezone })} ${timezone.toUpperCase()} | ${giveaway["winner"]} Winner(s) | ID: ${giveaway["id"]}`
                                                                        }
                                                                    }

                                                                    giveawayChannel.send({
                                                                            embed: giveawayEmbed
                                                                        })
                                                                        .then(giveMsg => {
                                                                            giveMsg.react("🎉");
                                                                            giveaway["giveawayMessageID"] = giveMsg.id;
                                                                            var giveawaySysData = Actions.giveawaySystem;

                                                                            if (!giveawaySysData.hasOwnProperty(msg.guild.id)) {
                                                                                giveawaySysData[msg.guild.id] = [];
                                                                            }

                                                                            giveawaySysData[msg.guild.id].push(giveaway);

                                                                            fs.writeFile("./data/giveawaySystem/giveawayData.json", JSON.stringify(giveawaySysData), function(err) {
                                                                                if (err) {
                                                                                    return console.log(err);
                                                                                }
                                                                            });
                                                                        });
                                                                    mainMessage.delete();
                                                                } else {
                                                                    errorMessage("Nie podałeś prawidłowego kanału !\nEx. #example\n\nExiting setup;uruchom ponownie polecenie, aby zrestartować monit. "," Użytkownik nie wspomniał o prawidłowym kanale. ");
                                                                }
                                                            });
                                                        } else {
                                                            errorMessage("Nie podałeś prawidłowego formatu czasu! \nEx. 1w | 1d | 1h | 1m\n\nExiting setup; uruchom ponownie polecenie, aby ponownie uruchomić monit. "," Użytkownik nie wprowadził prawidłowego formatu czasu, takiego jak  1d, 1m, 1h");
                                                        }
                                                    } else {
                                                        errorMessage("Nie podałeś prawidłowego formatu czasu !\nEx. 1w | 1d | 1h | 1m\n\nExiting setup; uruchom ponownie polecenie, aby ponownie uruchomić monit. "," Użytkownik nie wprowadził prawidłowego formatu czasu, takiego jak  1d, 1m, 1h");
                                                    }
                                                });

                                            } else {
                                                errorMessage("Nie podałeś prawidłowej liczby zwycięzców .\nExiting setup; uruchom ponownie polecenie, aby ponownie uruchomić monit. "," Użytkownik nie wprowadził prawidłowej liczby zwycięzców (liczba nie jest dodatnia) .");
                                            }
                                        } else {
                                            errorMessage("Nie podałeś prawidłowej liczby zwycięzców .\nExiting setup; uruchom ponownie polecenie, aby ponownie uruchomić monit. "," Użytkownik nie podał liczby określającej liczbę zwycięzców .");
                                        }
                                    });
                                });
                            } else {
                                errorMessage('Zapytanie anulowane z powodu odpowiedzi użytkownika (użytkownik nie odpowiedział „confirm”)..\nWykonaj ponownie polecenie, aby ponownie uruchomić monit! ', "Użytkownik nie odpowiedział potwierdzeniem, a zatem monit został anulowany. ");
                            }
                        });
                    }
                });
            });
        })
} else {
    errorMessage("Nie masz `MANAGE ROLES`perimssion, która jest wymagana do wykonania tego polecenia! "," Użytkownik nie ma uprawnień do wykonania polecenia .");
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = {
        color: 0xFF0000,
        author: {
            name: client.user.username,
            icon_url: client.user.avatarURL
        },
        title: "Giveaway Setup",
        description: error,
        timestamp: new Date(),
    }

    msg.channel.send({
        embed: errorTemplate
    });
}

function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit({
            embed: embedTemplate
        });
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Przepraszamy, nie podałeś prawidłowej odpowiedzi na czas! \ Wykonaj ponownie polecenie, aby ponownie przejść przez monit! ', error, message);
            });
    })

}

